export default {
    greenhouseUser(state) {
        return state.greenhouseUser;
    },
    hasgreenHouseUser(state) {
        console.log('we have reached the hasCoaches getter')
        return state.greenhouseUser && state.greenhouseUser.length > 0;
    },
    isGreenHouseUser(_, getters, _2, rootGetters) {
        const users = getters.greenhouseUser;
        const userId = rootGetters.userId;
        return users.some(user=> user.id === userId);
    }
};
